import { LogoContainer, NavbarContainer } from './styles'
import HomeRoundedIcon from '@mui/icons-material/HomeRounded';

const Header = () => {
    return(
        <NavbarContainer>
            <LogoContainer>Traceable</LogoContainer>
           <HomeRoundedIcon style={{ fill: '#ec8f4d' }}/>
        </NavbarContainer>
    )
}

export default Header
